      files.shift()
      files.sort()
      files.forEach(function(file) {
        file = file.replace("./","")
        link = "https://robons.github.io/csvw-test/"+file
        html_str += "<li>"+"<a href='"+ link + "'>"+file+"</a></li>";

      html_str += "</ul>";
      document.getElementById("files-container").innerHTML = html_str;
